import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';
import * as serviceWorker from './serviceWorker';
import {MongoClient} from "mongodb"

ReactDOM.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>,
  document.getElementById('root')
);

// If you want your app to work offline and load faster, you can change
// unregister() to register() below. Note this comes with some pitfalls.
// Learn more about service workers: https://bit.ly/CRA-PWA
serviceWorker.unregister();

//mongodb://ashish:<password>@todolist-shard-00-00-lj2nn.mongodb.net:27017,todolist-shard-00-01-lj2nn.mongodb.net:27017,todolist-shard-00-02-lj2nn.mongodb.net:27017/test?ssl=true&replicaSet=todoList-shard-0&authSource=admin&retryWrites=true&w=majority
//mongodb+srv://ashish:<password>@todolist-lj2nn.mongodb.net/test?retryWrites=true&w=majority
const url = "mongodb+srv://ashish:ash123@todolist-lj2nn.mongodb.net/test?retryWrites=true&w=majority"
const client = new MongoClient(url)

async function run () {
  try {
    await client.connect();
  }
  catch (err) {
    console.log(err)
  }
  finally {
    await client.close()
  }
}

